description:
Tagline - Her nightmare is woven in blood and straw.

After her parents are killed by the psychotic Basketweave, 10-year-old Ally Van Duren is committed to an insane asylum. Ten years later she is still there, now a beautiful young woman who is terrified by a sadistic nurse. Like many patients at the asylum, Ally is forced to take massive doses of expiramental drugs developed by the manager of the institution, the secretive Dr. Emil Stravinsky. As she consumes more and more of these drugs, she becomes lost in a hallucinogenic dream world where she encounters her horrifying past., present and future.

